oxy_webhelp_navlinks = {"k8s_cluster_onboard_discover_rsc-d22872e29888":{"topics":[{"title":"Default protection sets","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> includes default protection sets that are automatically created         for Kubernetes clusters. These protection sets include all namespaces, and relieve you of         having to create protection sets manually.<\/p>","href":"kubernetes\/k8s_default_protection_sets.html","attributes":{"data-id":"k8s_default_protection_sets"},"menu":{"hasChildren":false},"tocID":"k8s_default_protection_sets-d22872e29905","topics":[]},{"title":"Adding a Kubernetes cluster to <span class=\"ph\">RSC<\/span>","shortdesc":"<p class=\"shortdesc\">To protect the applications and data in your distribution cluster, add the Kubernetes         cluster to <span class=\"ph\">RSC<\/span> by uploading a kubeconfig or applying a generated         manifest.<\/p>","href":"kubernetes\/k8s_adding_k8s_cluster.html","attributes":{"data-id":"k8s_adding_k8s_cluster"},"menu":{"hasChildren":false},"tocID":"k8s_adding_k8s_cluster-d22872e29918","topics":[]},{"title":"Adding an Amazon EKS cluster to <span class=\"ph\">RSC<\/span>","shortdesc":"<p class=\"shortdesc\">To protect the applications and data in an Amazon EKS cluster, add the EKS cluster to             <span class=\"ph\">RSC<\/span> by configuring an AWS cloud account and an ARN for the EKS         cluster.<\/p>","href":"kubernetes\/k8s_adding_amazon_eks_cluster.html","attributes":{"data-id":"k8s_adding_amazon_eks_cluster"},"menu":{"hasChildren":false},"tocID":"k8s_adding_amazon_eks_cluster-d22872e29934","topics":[]},{"title":"Editing the Kubernetes cluster","shortdesc":"<p class=\"shortdesc\">You can edit the Kubernetes cluster for manifest and kubeconfig         onboarding.<\/p>","href":"kubernetes\/k8s_editing_kubernetes_cluster.html","attributes":{"data-id":"k8s_editing_kubernetes_cluster"},"menu":{"hasChildren":false},"tocID":"k8s_editing_kubernetes_cluster-d22872e29950","topics":[]},{"title":"Manifest-based onboarding resources","shortdesc":"<p class=\"shortdesc\">When you onboard a Kubernetes cluster using the manifest-based method, some resources         are deployed in the Kubernetes cluster. After the connection is established, <span class=\"ph\">RSC<\/span> deploys additional resources during the first refresh job.<\/p>","href":"kubernetes\/k8s_manifest_based_onboarding_resources.html","attributes":{"data-id":"k8s_manifest_based_onboarding_resources"},"menu":{"hasChildren":false},"tocID":"k8s_manifest_based_onboarding_resources-d22872e29961","topics":[]},{"title":"Deleting a Kubernetes cluster","shortdesc":"<p class=\"shortdesc\">Delete a Kubernetes cluster from <span class=\"ph\">RSC<\/span> to stop protecting the data and         applications associated with the protection sets of the cluster.<\/p>","href":"kubernetes\/k8s_deleting_k8s_cluster.html","attributes":{"data-id":"k8s_deleting_k8s_cluster"},"menu":{"hasChildren":false},"tocID":"k8s_deleting_k8s_cluster-d22872e29975","topics":[]},{"title":"Viewing the manifest file","shortdesc":"<p class=\"shortdesc\">For Kubernetes clusters that were added to <span class=\"ph\">RSC<\/span> using an manifest         file, you can view that file to determine whether it is producing the appropriate state for         Kubernetes objects within the cluster.<\/p>","href":"kubernetes\/k8s_viewing_manifest_file.html","attributes":{"data-id":"k8s_viewing_manifest_file"},"menu":{"hasChildren":false},"tocID":"k8s_viewing_manifest_file-d22872e29989","topics":[]},{"title":"Refreshing a Kubernetes cluster","shortdesc":"<p class=\"shortdesc\">Start a refresh of a Kubernetes cluster to update the information for the protected         namespaces on that cluster.<\/p>","href":"kubernetes\/k8s_refreshing_k8s_cluster.html","attributes":{"data-id":"k8s_refreshing_k8s_cluster"},"menu":{"hasChildren":false},"tocID":"k8s_refreshing_k8s_cluster-d22872e30003","topics":[]},{"title":"Regenerating the manifest file","shortdesc":"<p class=\"shortdesc\">Regenerate the manifest file to update the Kubernetes cluster         configuration.<\/p>","href":"kubernetes\/regenerating_manifest_file.html","attributes":{"data-id":"regenerating_manifest_file"},"menu":{"hasChildren":false},"tocID":"regenerating_manifest_file-d22872e30014","topics":[]}]}};